import React, { useState } from 'react';
import 'C:/Users/Asus ZenBook 14/Desktop/My-github/Invoice Project/src/css/Table.css'; // Import custom CSS file for styling

const TableWithData = ({ data, setData, itemsPerPage }) => {
  const [currentPage, setCurrentPage] = useState(1);
  const [selectedRow, setSelectedRow] = useState(null);

  const totalPages = Math.ceil(data.length / itemsPerPage);

  const handleChangePage = (page) => {
    setCurrentPage(page);
  };

  const handleShowModal = (rowData) => {
    setSelectedRow(rowData);
  };

  const handleCloseModal = () => {
    setSelectedRow(null);
  };

  const handleDelete = () => {
    if (window.confirm("Êtes-vous sûr de vouloir supprimer cette entrée ?")) {
      const newData = data.filter(item => item !== selectedRow);
      setData(newData);
      setSelectedRow(null);
    }
  };

  const renderTableData = () => {
    const startIndex = (currentPage - 1) * itemsPerPage;
    const endIndex = startIndex + itemsPerPage;
    return data.slice(startIndex, endIndex).map((item, index) => (
      <tr key={index}>
        <td>{item.column1}</td>
        <td>{item.column2}</td>
        <td>{item.column3}</td>
        <td>{item.column4}</td>
        <td>{item.column5}</td>
        <td>
          <button className="btn btn-primary" onClick={() => handleShowModal(item)}>Plus d'infos</button>
        </td>
      </tr>
    ));
  };

  const renderModal = () => {
    if (!selectedRow) return null;

    return (
      <div className="modal">
        <div className="modal-content">
          <span className="close" onClick={handleCloseModal}>&times;</span>
          <h2>Details</h2>
          {/* Details omitted for brevity */}
          <button onClick={handleDelete} className="btn btn-danger">Supprimer</button>
        </div>
      </div>
    );
  };

  return (
    <div className="table-container">
      <table className="table">
        <thead>
          <tr>
            <th>Nº de Facture</th>
            <th>Nom Client</th>
            <th>Nº Bon de livraison</th>
            <th>Type de validation</th>
            <th>Mode de Règlement</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {renderTableData()}
        </tbody>
      </table>
      {renderModal()}
    </div>
  );
};

export default TableWithData;
